CREATE TABLE IF NOT EXISTS program (
	id_program INTEGER PRIMARY KEY,
	saturation INTEGER,
	contrast INTEGER,
	brightness INTEGER,
	X INTEGER,
	Y INTEGER,
	width INTEGER,
	high INTEGER,
	umbral INTEGER,
	zoom INTEGER,
	origin_x INTEGER,
	origin_y INTEGER,
	external INTEGER,
	internal INTEGER,
	mask_on BOOLEAN,
	type_model INTEGER,
	path_model_load VARCHAR(128),
	creation_date date,
	lastupdate_date date,
	no_part varchar(50),
	JF_size varchar(50),
	ball_number INTEGER,
	ball_diameter FLOAT,
	save_images BOOLEAN
);

COMMIT;

   